import "./Selection.css";
import Button from "./Button";

const Selection = () => {
    return (
        <div className = "Selection">
            <div><Button text="이게 맵다고? 수준"/></div>
            <div><Button text="맛있게 맵다"/></div>
            <div><Button text="3번 선택지"/></div>
            <div><Button text="4번 선택지"/></div>
            <div><Button text="5번 선택지"/></div>
        </div>
    );
}

export default Selection;
